function ClerkRoomDisplay({ imgLink, title, cost}) {

    return (
        <div className="box-display">
            <img src={imgLink} alt={title} />
            <h2>{title}</h2>
            <p>{cost}</p>
            <button>Modify</button> 
            <button>Status</button> 
        </div>
    );
}

export default ClerkRoomDisplay;
